export const ALL_CHARACTER = "ALL_CHARACTER"; 

const apiKey= ("59b081836f2447fb934547a11a2cf148");

export function allCharacter() {
    // tu codigo acÃ¡
    return function (dispatch) {
        fetch(`https://api.spoonacular.com/recipes/complexSearch?apiKey=${apiKey}`)
            .then(res => res.json())
            .then(data => {
                dispatch({ type: ALL_CHARACTER, payload: data })
            })
    }
}
